import React from "react";

const blurbStyle = {
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-evenly",
    flexWrap: "wrap",
    alignItems: "flex-start",
    width: "100%"
};

export const TextBlurb = ({ ...props }) => (
    <div style={blurbStyle}>
        {props.title}
        {props.text}
    </div>
)

export default textBlurb;
